import {makeAutoObservable} from 'mobx' //изменения 

export default class PhotoStore{
    constructor(){
        this._types =[
            {id:1, name:'Ваши фото'},
            { id:2, name:'Популярные фото'},
            { id:3, name:'Фото друзей'},
            { id:2, name:'Фото природы'},
            { id:2, name:'Смешные фото'},
        ]
        this._photo =[
            {id:1, name: "Фотография любимой",img:'https://sun9-44.userapi.com/impg/t7b8nwZFPwZ2EEf4gQfEv_xZUikDZucUzwvTaw/liCqQH_QYiM.jpg?size=854x1080&quality=96&sign=9bcb18a73a87ba5d0b1ac9be331eb2a3&type=album' },
            {id:2, name: "Фотография себя",img:'https://sun9-66.userapi.com/impg/d1hpun8pzTHq9iNeET9FgH_kEjR5Xey15vilTw/9iKBOD0eDb0.jpg?size=755x1080&quality=96&sign=5cc0f8349308153af19e57d345d341dd&type=album'}
        ]

        makeAutoObservable(this)//слежка за изменениями

    }//при изменении перерендеринг

    setTypes(bool){
        this._types = bool
    }

    setPhoto(user){
        this._photo = user
    }

    //компьютед функции, вызываются только при изменении
    get isTypes(){
        return this._types
    }
    get isPhoto(){
        return this._photo
    }


}
